about_us:
Blueprint Software BV is in 2010 opgericht en komt voort uit Maslink Media. Maslink Media is in 2004 opgericht door Arian en Roel Masselink. In de loop van de tijd ging Maslink Media steeds meer software ontwikkeling doen. Hierdoor dekte de naam de lading niet meer goed, vandaar dat de naam is gewijzigd naar Blueprint Software BV.

Eind 2013 is Arian Masselink volledig eigenaar geworden. Binnen Blueprint Software BV worden hoofdzakelijk iOS en Android Apps ontwikkeld. Vaak zijn dit complexe Apps om bedrijfsprocessen te automatiseren. Binnen Blueprint Software is veel ruimte om met nieuwe technieken bezig te zijn, wij werken volgens een 80-20 mentaliteit zodat we iedere 5 werkdagen proberen 1 dag bezig te zijn met eigen innovatieve projecten. Dit kunnen projecten zijn waarbij gebruik wordt gemaakt van smartwatches, binnenkort de Google Glass of andere nieuwe gadgets. Er is binnen Blueprint Software veel ruimte om te leren en jezelf verder te ontwikkelen.

//In 2017 is Blueprint Software BV gestopt het haar activiteiten.

From May 1991 the founding of DVD Multimedia we developt several software programs as administrative, training and educational applications. 
1992 to 1996 - Regional Educational Course selection;
1992 to 1998 - Marketing tool for Educational Courses (CRM-system);
1994 to 1998 - Manage Scholing for Health and Social Work Instituts (HRM-program)
1995 to 2000 - Information Systems for Educational Study Choices 
1996 to 2004 - Traningcentre for ICT & Multimedia Courses (MS Office & Macromedia Tools)
2002 to 2007 - Remedial Teaching Testprogram HADION
From 1999 - Remedial Teaching program: Multitrainer 
From 2009 - Developing the e-Learning program Compiade.
Our field of work is advice, design en development of:  
* Educational Sofware;
* e-Learning Concepts & Platforms;
* educational content;
* Educational Sociology  Research.

Ben jij ondernemer? Kom jij (vrije) tijd te kort om je bezig te houden met zaken die jij echt belangrijk vindt, de reden waarom jij ondernemer geworden bent? Dan wordt het tijd voor een Virtual Assistent (VA), oftewel Virtuele Assistent. 

Ik zorg als VA voor rust, tijd, structuur en overzicht in jouw agenda en werkzaamheden, waardoor jij meer (vrije) tijd hebt voor zaken die voor jou echt belangrijk zijn. Op deze manier help ik mee met de groei van jouw onderneming. 

Enkele voordelen zijn:
- meer (vrije) tijd voor zaken die voor jou echt belangrijk zijn;
- Het inrichten van kantoorruimte is niet nodig, omdat ik vanuit mijn eigen kantoor werk;
- Geen kosten voor o.a. personeelsverzekeringen, pensioen opbouw en reservering vakantiegeld;
- Geen doorbetaling bij ziekte;
- Flexibele werktijden.

Wil je meer te weten komen? Kijk dan op www.Elvirtual.nl.

NOA positions itself as a Brand Management Operations agency: 
the production organisation of a brand consultancy, the extension of an advertising agency, the content provider for a media agency and the 24/7 brand concierge service for a brand owner. 
As is the case with any concierge service, the goal is to provide tangible results, added value, and convenience to clients.  
This is what NOA delivers: we continuously and consistently tell and convey a brand story and contribute to the value proposition in order to obtain and secure the desired brand experience, awareness, pride and positioning.

We do this by means of:
- Content marketing, in hard and soft copy: from editorials to brand films;
- Community management on and offline, from social media channels to internal newsletters;
- Event management on and offline, from product introductions to periodic webcasts by the management;
- Experiential marketing, from an urban guerrilla approach and popup product experiences to visitor engagement at trade exhibitions;
- Sponsorship & talent management, from activation to co-branding.

Zwolle, een heerlijke plek om te wonen en te werken, een heerlijke plek om te leven!

Regio Zwolle IT Platform is een samenwerkingsverband tussen een breed assortiment aan IT organisaties in de regio Zwolle; een platform voor IT in de regio Zwolle. Samen willen wij IT Professionals laten zien wat voor moois de regio Zwolle te bieden heeft op IT gebied. Prachtige hoogstaande producten en ontwerpen, ervaren en gedreven collega’s, stabiele gezonde organisaties en zoveel meer;
Regio Zwolle IT Platform is een initiatief om het tekort op de IT arbeidsmarkt op een ambitieuze en innovatieve manier om te zetten van een probleem naar een kans. Wij geloven niet dat een krappe arbeidsmarkt je tegen kan houden om te groeien en bloeien. Door out-of-the-box denken en samenwerken kunnen we vanuit die verbinding zoveel meer lawaai maken op de arbeidsmarkt en IT Professionals ervan overtuigen dat de regio Zwolle ‘the place to be’ is;
Regio Zwolle IT Platform is samenwerken op het hoogste niveau; partners die elkaar versterken in recruitment en arbeidsmarktcommunicatie;
Regio Zwolle IT Platform zet de regio Zwolle op de kaart als dé IT regio van Nederland met een zeer aangenaam en concurrerend woon-, werk- en leef klimaat

Regio Zwolle IT Platform is elkaar gunnen, elkaar helpen en elkaar sterker maken

Regio Zwolle IT Platform is kennis, techniek en inzet bundelen om een Zwolse stempel op de Nederlandse IT wereld te zetten

Betrokkenheid en vertrouwen van de partners is dé drijvende factor achter het initiatief.

Verbonden - Ambitieus - Ontwikkeling - Innovatie - Vertrouwen

Speaking the language of the customer and understanding the business processes of the customer are the basis for a good ERP Implementation.
SF Dynamics Consultancy offers consultancy for implementation and software selection with focus on finance processes, based on experience in several finance roles in multiple organizations.
Specialized in Microsoft Dynamics AX and Microsoft Dynamics 365 for Finance and Operations solution, with over more than 6 years experience in implementing Dynamics ERP solutions.

Freelance Consultancy in Dynamics ERP Implementations:
• Supporting project implementation team through partner or end user organizations;
• Analyzing and document business processes;
• Develop blue prints in translating business processes to ERP systems (focus Microsoft Dynamics 365);
• Requirements analysis, fit/gap analysis, functional design and test custom solutions;
• Educating key users and end users;
• Hypercare and after golive support.

Onze dienst is een centrale website om tweedehands studieboeken gratis te verhandelen.
We hebben de website speciaal gemaakt voor alle 18.000 studenten die in Zwolle op de locatie Windesheim studeren.

Het doel van deze website is het makkelijk verhandelen van je tweedehandse studieboeken.

    - Geen verzendkosten;
    - Geen bemiddelingskosten;
    - Geen servicekosten;
    - Meer controle over de kwaliteit van de boeken door fysieke overdracht;
    - Sneller je boek in bezit.

Het aanmaken van een account is geheel gratis voor de koper en de verkoper van een boek.
